import React, { Component } from 'react';

export default class Footer extends Component {
	render() {
		return (
			<div id="footer">
	            <ul className="copyright">
	              <li>&copy; Untitled.</li><li>Design: <a href="http://html5up.net">HTML5 UP</a></li>
	            </ul>
			</div>
		);
	}
}
